void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = (fragCoord * 2.0 - iResolution.xy) / iResolution.y;
    vec2 uv0 = uv;
    float d = (length(uv)+0.4) * exp(-length(uv0));
    d = sin(d*6. + (1.75 * iTime))/6.;
    d = abs(d);
    d = pow(0.01 / d, 1.2);

    float s = (length(uv)+0.4) * exp(length(uv0));
    s = sin(s*2. + (1.5*iTime))/2.;
    s = abs(s);
    s = pow(0.05 / s, 0.7);

    float r = (length(uv)+0.8) * exp(length(uv0));
    r = sin(r*5. + (2.5*iTime))/5.;
    r = abs(r);
    r = pow(0.03 / r, 1.5);
    fragColor = vec4(d, r, s, 1.0);
}
